    },
    {
      "id": "12",
      "titulo": "Frankenstein: edição bolso",
      "autor": "Mary Shelley",
      "editora": "Clássicos Zahar",
      "preco":"21,00",
      "imagem": "https://m.media-amazon.com/images/I/91Kz+sC5X0L._SL1500_.jpg"
    }
]

const OpcoesLivros = styled.section`
    display: flex;
    margin: 4% 20%;
    flex-wrap: wrap;
    gap: 7px;
    
`
    
const Card = styled.div`
    display: flex;
    flex-direction:column;
    width: 190px;
    heigth: 50px;
    background-color: #ffffff;
    border-radius: 12px;
    text-align: center;
    padding: 9px;
    cursor: pointer;

    &:hover{
        background-color: #bfffff;
        color: #801519;
        text-shadow: 0px 0px 3px #801519;
      }

`
    
const CapaLivro = styled.img`
    cursor: pointer;
    width: 150px;
`
const TituloLivro = styled.h2`
    font-family: Arial, Helvetica, sans-serif;
    font-size: 1rem;
    cursor: pointer;
`
    
const AutorLivro = styled.p`
    font-family: Arial, Helvetica, sans-serif;
    font-size: 0.7rem;
    cursor: pointer;
    
`
    
const EditoraLivro = styled.p`
    font-family: Arial, Helvetica, sans-serif;
    font-size: 0.6rem;
    cursor: pointer;
        
`
    
const PrecoLivro = styled.h3`
    font-family: Arial, Helvetica, sans-serif;
    font-size: 2.4rem;
    cursor: pointer;
`

const Dados = styled.div``



function CardLivros(){
    return(
        <OpcoesLivros>
            {livro.map((texto) =>(
                <Card>
                    <div>
                        <CapaLivro src={texto.imagem} alt="capa do livro"></CapaLivro> 
                    </div>
                    <Dados>
                        <TituloLivro>{texto.titulo}</TituloLivro>
                        <AutorLivro>{texto.autor}</AutorLivro>
                        <EditoraLivro>{texto.editora}</EditoraLivro>
                        <PrecoLivro>R$ {texto.preco}</PrecoLivro>
                    </Dados>
                </Card>
            ))}
        </OpcoesLivros>
          
    )
}

export default CardLivros
